using SchoolEF.Data;
using SchoolEF.Models;

using (var context = new SchoolContext())
{
    //Grade grade = new Grade();
    //grade.GradeName = "Primero";
    //grade.Section = "C";
    //context.Grades.Add(grade);
    //context.SaveChanges();

    Student student = new Student();
    student.FirstName = "Moisés";
    student.LastName = "Gallegos";
    student.DateOfBirth = DateTime.Now;
    student.Photo = Convert.FromBase64String("");
    student.Height = 150;
    student.Weight = 150;
    student.GradeId = 2;
    context.Students.Add(student);
    context.SaveChanges();

    // Mostrar estudiantes del Primero B
    var innerJoin = context.Students.Join(
    context.Grades,
    student => student.GradeId,
    grade => grade.GradeId,
    (student, grade) => new
    {
        StudentFirstName = student.FirstName,
        StudentLastName = student.LastName,
        GradeName = grade.GradeName,
        GradeSection = grade.Section
    }).Where(grade => grade.GradeName == "Primero" && grade.GradeSection == "B");

    foreach (var item in innerJoin.ToList())
        Console.WriteLine($"Nombre: {item.StudentFirstName} {item.StudentLastName}\t" +
            $"Grado: {item.GradeName} {item.GradeSection}");
}